import React, {Component} from 'react';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {};
  }
  render(){
    return(
      <div>
      <ul id="nav">
              <li><a href="#">Sign Up</a></li>
              <li><a href="/login">Login</a></li>
              <li><a href="#">User Page</a></li>
              <li><a href="#">About Us</a></li>
            </ul>
            <h1>Welcome</h1>
            <p>Description of what the app does.</p>
      </div>

    );
  }
}

export default App;
